import React from 'react';
import ReactDOM from 'react-dom/client';
// import { BrowserRouter } from 'react-router-dom';


import {App} from './App';


import './index.css';


const rootElem = document.getElementById('root')

if (rootElem) {
  const root = ReactDOM.createRoot(rootElem);
  root.render(

      <React.StrictMode>
        <App />
      </React.StrictMode>

  );
}
